import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Snackbar,
  Alert,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import SendIcon from '@mui/icons-material/Send';
import CancelIcon from '@mui/icons-material/Cancel';
import { useNavigate } from 'react-router-dom';

export default function ContactoFullPage() {
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const [formData, setFormData] = React.useState({
    nombre: '',
    correo: '',
    asunto: '',
    mensaje: '',
  });

  const [errores, setErrores] = React.useState({});
  const [enviado, setEnviado] = React.useState(false);

  const validar = () => {
    const newErrors = {};
    const correoRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

    if (!formData.nombre.trim()) newErrors.nombre = 'Este campo es obligatorio';
    if (!formData.correo || !correoRegex.test(formData.correo))
      newErrors.correo = 'Ingrese un correo válido';
    if (!formData.asunto.trim()) newErrors.asunto = 'Debe ingresar un asunto';
    if (!formData.mensaje.trim()) newErrors.mensaje = 'Debe escribir un mensaje';

    setErrores(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      console.log('Mensaje enviado:', formData);
      setEnviado(true);
      setFormData({ nombre: '', correo: '', asunto: '', mensaje: '' });
      setTimeout(() => navigate(-1), 3000);
    }
  };

  const handleCancel = () => {
    navigate(-1);
  };

  return (
    <Box
      component="main"
      sx={{
        minHeight: '100vh',
        bgcolor: '#f5f7fa',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        px: isMobile ? 2 : 8,
        py: 6,
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      }}
    >
      <Typography
        variant={isMobile ? 'h4' : 'h3'}
        component="h1"
        sx={{
          textAlign: 'center',
          fontWeight: '900',
          mb: 4,
          color: '#2e7d32',
          letterSpacing: 1.2,
          userSelect: 'none',
        }}
      >
        Solicita tu asesoría personalizada
      </Typography>

      <Box
        component="form"
        onSubmit={handleSubmit}
        noValidate
        sx={{
          maxWidth: 700,
          mx: 'auto',
          display: 'flex',
          flexDirection: 'column',
          gap: 4,
        }}
      >
        {/* Campos con floating label (variant standard es ideal para esto) */}
        <TextField
          name="nombre"
          label="Nombre"
          variant="standard"
          fullWidth
          value={formData.nombre}
          onChange={(e) =>
            setFormData((prev) => ({ ...prev, nombre: e.target.value }))
          }
          error={!!errores.nombre}
          helperText={errores.nombre}
          InputLabelProps={{ shrink: true }}
          sx={{
            '& .MuiInput-underline:before': { borderBottomColor: '#a5d6a7' },
            '& .MuiInput-underline:hover:not(.Mui-disabled):before': {
              borderBottomColor: '#2e7d32',
            },
            '& .MuiInput-underline:after': {
              borderBottomColor: '#2e7d32',
            },
          }}
        />

        <TextField
          name="correo"
          label="Correo electrónico"
          variant="standard"
          fullWidth
          value={formData.correo}
          onChange={(e) =>
            setFormData((prev) => ({ ...prev, correo: e.target.value }))
          }
          error={!!errores.correo}
          helperText={errores.correo}
          InputLabelProps={{ shrink: true }}
          sx={{
            '& .MuiInput-underline:before': { borderBottomColor: '#a5d6a7' },
            '& .MuiInput-underline:hover:not(.Mui-disabled):before': {
              borderBottomColor: '#2e7d32',
            },
            '& .MuiInput-underline:after': {
              borderBottomColor: '#2e7d32',
            },
          }}
        />

        <TextField
          name="asunto"
          label="Asunto"
          variant="standard"
          fullWidth
          value={formData.asunto}
          onChange={(e) =>
            setFormData((prev) => ({ ...prev, asunto: e.target.value }))
          }
          error={!!errores.asunto}
          helperText={errores.asunto}
          InputLabelProps={{ shrink: true }}
          sx={{
            '& .MuiInput-underline:before': { borderBottomColor: '#a5d6a7' },
            '& .MuiInput-underline:hover:not(.Mui-disabled):before': {
              borderBottomColor: '#2e7d32',
            },
            '& .MuiInput-underline:after': {
              borderBottomColor: '#2e7d32',
            },
          }}
        />

        <TextField
          name="mensaje"
          label="Mensaje"
          variant="standard"
          multiline
          rows={6}
          fullWidth
          value={formData.mensaje}
          onChange={(e) =>
            setFormData((prev) => ({ ...prev, mensaje: e.target.value }))
          }
          error={!!errores.mensaje}
          helperText={errores.mensaje}
          InputLabelProps={{ shrink: true }}
          sx={{
            '& .MuiInput-underline:before': { borderBottomColor: '#a5d6a7' },
            '& .MuiInput-underline:hover:not(.Mui-disabled):before': {
              borderBottomColor: '#2e7d32',
            },
            '& .MuiInput-underline:after': {
              borderBottomColor: '#2e7d32',
            },
          }}
        />

        <Box
          sx={{
            display: 'flex',
            gap: 2,
            flexDirection: isMobile ? 'column' : 'row',
            mt: 3,
          }}
        >
          <Button
            type="submit"
            variant="contained"
            fullWidth={isMobile}
            sx={{
              bgcolor: '#388e3c',
              fontWeight: 'bold',
              fontSize: '1.1rem',
              py: 1.5,
              borderRadius: 3,
              transition: 'background-color 0.3s',
              '&:hover': { bgcolor: '#2e7d32' },
            }}
          >
            Enviar solicitud
          </Button>

          <Button
            variant="outlined"
            fullWidth={isMobile}
            color="error"
            sx={{
              fontWeight: 'bold',
              fontSize: '1.1rem',
              py: 1.5,
              borderRadius: 3,
            }}
            onClick={handleCancel}
          >
            Cancelar
          </Button>
        </Box>
      </Box>

      <Snackbar
        open={enviado}
        autoHideDuration={4000}
        onClose={() => setEnviado(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert
          severity="success"
          variant="filled"
          onClose={() => setEnviado(false)}
          sx={{ bgcolor: '#2e7d32', color: 'white' }}
        >
          ¡Tu solicitud ha sido enviada correctamente!
        </Alert>
      </Snackbar>
    </Box>
  );
}
